import { useEffect,useState } from "react";
import { useParams } from "react-router";
import CarAnnonce from "./components/CarAnnonce";
import PropertyAnnonce from "./components/PropertyAnnonce";
import ContactInformation from "./Seller";
import PhotoAndDescription from "./Media";
import Spinner from "../../Component/Spinner/Spinner";

function AnnonceRoute(props) {
    var {categoryName} = useParams();
    const [annonceComponent, setComponent] = useState(<></>);
    const [isLoading, setLoading] = useState(true);
    const [properties, setProperties] = useState(null);

    function findCategory(){
        if(isLoading){
            switch (categoryName) {
                case "bil":
                    setComponent(<CarAnnonce></CarAnnonce>)
                    setLoading(false);
                    break;
                case "enebolig":
                    setComponent(<PropertyAnnonce></PropertyAnnonce>)
                    setLoading(false);
                    break;
                default:
                    setComponent(<p>Annonce type couldn't found!</p>);
                    setLoading(false);
                    break;
            }
        }          
    }

    const handlePropertiesChange = (e) => {

    }

    useEffect(() => {
        findCategory();
    })

    return(

        <div>
            { !isLoading ?
                <div>
                    <h4>Properties</h4>
                    <label className="form-label" htmlFor="title">Tittelen</label>
                    <div className="input-group mb-3">
                        <input type="text" className="form-control" id="title" aria-describedby="title" />
                    </div>
                    <label className="form-label" htmlFor="price">Price</label>
                    <div className="input-group mb-3">
                        <input type="text" className="form-control" id="price" aria-describedby="title" />
                    </div>
                    {annonceComponent} 
                    <PhotoAndDescription ></PhotoAndDescription>
                    <ContactInformation></ContactInformation> 
                    <button className="btn btn-primary w-100 mb-4">Publish</button>
                </div>
                :
                <Spinner/>
            }               
        </div>
    )
}

export default AnnonceRoute;
